import React, { useState } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';


function UserInput() {


  return (
    <div>
      <h2>Home</h2>

      <p>
        This page is to help you create SQL queries for the database.
        Please choose relevant phrase from the buttons below and fill in the blanks.
        Here are some examples of queries you can make:
        - What is Doctor Tan's ID?
        - What is the name of the patient with ID 001?
        - Which date did Doctor Tan issued the prescription with ID 010?
        - What is the dosage for the medication with ID 100?
      </p>

      <Stack direction="row" spacing={2} justifyContent="center">
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Patients
        </Button>
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Doctors
        </Button>
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Prescriptions
        </Button>
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Medications
        </Button>
        <Button variant="outlined"
          sx={{
            fontSize: '15px', 
            borderWidth: '2px',
          }}
        > Prescription Details
        </Button>
      </Stack>

      <br />

      <Box
        component="form"
        sx={{
          '& > :not(style)': { m: 1, width: '75ch' },
        }}
        noValidate
        autoComplete="off"
      >
        <TextField id="outlined-basic" label="Outlined" variant="outlined" />
        {/* <TextField id="filled-basic" label="Filled" variant="filled" />
        <TextField id="standard-basic" label="Standard" variant="standard" /> */}
      </Box>

    </div>
  );
}

export default UserInput;
